DROP TABLE mgn.mgn_countries;

CREATE TABLE mgn.mgn_countries
(
  country_id smallserial NOT NULL,
  short_name character varying(3) UNIQUE NOT NULL,
  full_name character varying(50) NOT NULL,
  isd_code character varying(10) NOT NULL,
  states jsonb NOT NULL,
  cities jsonb NOT NULL,
  is_active smallint NOT NULL DEFAULT 0,
  CONSTRAINT mgn_countries_id_pk PRIMARY KEY (country_id)
)
WITH (
  OIDS=FALSE
);


